import React, { Component } from "react";

import axios from 'axios';
import "./reg.css";

const regExp = RegExp(
    /^[a-zA-Z0-9]+@[a-zA-Z0-9]+\.[A-Za-z]+$/
)

const formValid = ({ isError, ...rest }) => {
    let isValid = false;

    Object.values(isError).forEach(val => {
        if (val.length > 0) {
            isValid = false
        } else {
            isValid = true
        }
    });

    Object.values(rest).forEach(val => {
        if (val === null) {
            isValid = false
        } else {
            isValid = true
        }
    });

    return isValid;
};

export default class UserForm extends Component {
    constructor(props) {
        super(props)

        this.state = {
            fname: '',
            lname: '',
            email: '',
            password: '',
            phoneNum:'',
            
            isError: {
                fname: '',
                lname: '',
                email: '',
                password: '',
                phoneNum:''
            }
        }
    }


    onSubmit = e => {
        e.preventDefault();

        if (formValid(this.state)) {
            console.log(this.state.email,"form Valid");
            let fname=this.state.fname
            let lname=this.state.lname
            let email=this.state.email
            let password=this.state.password
            let phoneNum=this.state.phoneNum

          axios.post('http://localhost/CARAGE/PHP.PHP/insert.php?name='+fname+'&email='+Email+'&password='+Password+'&phone_number='+Phone_number)
          window.location.href = "./Login";

          
            
        } else {
            console.log("Form is invalid!");
        }
    };



    formValChange = e => {
        e.preventDefault();
        const { name, value } = e.target;
        let isError = { ...this.state.isError };

        switch (fname) {
            case "fname":
                isError.fname =
                    value.length < 4 ? "Atleast 4 characaters required" : "";
                break;

            case "lname":
                isError.lname =
                    value.length < 4 ? "Atleast 4 characaters required" : "";
                break;

            case "email":
                isError.email = regExp.test(value)
                    ? ""
                    : "Email address is invalid";
                break;

            case "password":
                isError.password =
                    value.length < 6 ? "Atleast 6 characaters required" : "";
                break;

                case "phoneNum":
                  isError.phoneNum =
                      value.length < 9 ? "Atleast 10 characaters required" : "";
                  break;
                
            default:
                break;
        }

        this.setState({
            isError,
            [name]: value
        })
    };

    render() {
      console.log("Hello There");
        const { isError } = this.state;

        return (
            <div classname="forms">
            <form onsubmit="{this.onSubmit}" noValidate="">
              <h1>Registration</h1>
              <div classname="form-group">
                <div classname="form2">
                  <label>First Name</label>
                  <input type="text" classname="{isError.name.length" /> 0 ? "is-invalid
                  form-control" : "form-control"{"}"}
                  name="name" onChange={"{"}this.formValChange{"}"}
                  /&gt;
                  {"{"}isError.name.length &gt; 0 &amp;&amp; (
                  <span classname="invalid-feedback">
                    {"{"}isError.name{"}"}
                  </span>
                  ){"}"}
                </div>
                <label>Last Name</label>
                <input type="text" classname="{isError.lname.length" /> 0 ? "is-invalid
                form-control" : "form-control"{"}"}
                name="lname" onChange={"{"}this.formValChange{"}"}
                /&gt;
                {"{"}isError.lname.length &gt; 0 &amp;&amp; (
                <span classname="invalid-feedback">
                  {"{"}isError.lname{"}"}
                </span>
                ){"}"}
              </div>
              <div classname="form-group">
                <label>Email</label>
                <input type="email" classname="{isError.email.length" /> 0 ? "is-invalid
                form-control" : "form-control"{"}"}
                name="email" onChange={"{"}this.formValChange{"}"}
                /&gt;
                {"{"}isError.email.length &gt; 0 &amp;&amp; (
                <span classname="invalid-feedback">
                  {"{"}isError.email{"}"}
                </span>
                ){"}"}
              </div>
              <div classname="form-group">
                <label>password</label>
                <input type="password" classname="{isError.password.length" /> 0 ?
                "is-invalid form-control" : "form-control"{"}"}
                name="password" onChange={"{"}this.formValChange{"}"}
                /&gt;
                {"{"}isError.password.length &gt; 0 &amp;&amp; (
                <span classname="invalid-feedback">
                  {"{"}isError.password{"}"}
                </span>
                ){"}"}
              </div>
              <div classname="form-group">
                <label>Phone Number</label>
                <input type="tel" classname="{isError.phoneNum.length" /> 0 ? "is-invalid
                form-control" : "form-control"{"}"}
                name="phoneNum" onChange={"{"}this.formValChange{"}"}
                /&gt;
                {"{"}isError.phoneNum.length &gt; 0 &amp;&amp; (
                <span classname="invalid-feedback">
                  {"{"}isError.phoneNum{"}"}
                </span>
                ){"}"}
              </div>
              <button type="submit" classname="btn btn-block btn-danger">
                Create User
              </button>
            </form>
          </div>
          
           
        );
    }
}
